import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';
import './index.css';

// console.log(Sdata[3].sname);
ReactDOM.render(
    <>
        <h2 className="heading_style">My Favourite Top 5 Netflix Series</h2>
        <Cards
            sname={Sdata[0].sname}
            imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            link={Sdata[0].link}
        /> 
        <Cards
            sname={Sdata[1].sname}
            imgsrc={Sdata[1].imgsrc}
            title={Sdata[1].title}
            link={Sdata[1].link}
        /> 
        <Cards
            sname={Sdata[2].sname}
            imgsrc={Sdata[2].imgsrc}
            title={Sdata[2].title}
            link={Sdata[2].link}
        /> 
        <Cards
            sname={Sdata.sname}
            imgsrc={Sdata.imgsrc}
            title={Sdata.title}
            link={Sdata.link}
        /> 
        <Cards
            sname={Sdata.sname}
            imgsrc={Sdata.imgsrc}
            title={Sdata.title}
            link={Sdata.link}
        /> 
    </>
    , document.getElementById("root"));
